fields.formula:
IF( pse__Total_Number_Of_Logs__c = 0, 'Undefined',
	IF ( AND( pse__Total_Number_Of_Errors__c=0,pse__Total_Number_Of_Aborts__c=0,pse__Total_Number_Of_External__c=0),
		'Successful',
		IF(pse__Total_Number_Of_Errors__c = pse__Total_Number_Of_Logs__c,
			'Failure',
			IF(pse__Total_Number_Of_Aborts__c > 0,
				'Failure',
				IF( pse__Total_Number_Of_External__c > 0,
					'Failure',
					'Mixed'
				)
			)
		)
	)
)

IF( pse__Total_Number_of_Logs__c = 0, 'Undefined',
IF ( AND( pse__Total_Number_of_Errors__c=0,pse__Total_Number_of_Aborts__c=0,pse__Total_Number_of_External__c=0), 
'Successful', 
IF(pse__Total_Number_of_Errors__c = pse__Total_Number_of_Logs__c, 
'Failure', 
IF(pse__Total_Number_of_Aborts__c > 0, 
'Failure', 
IF( pse__Total_Number_of_External__c > 0, 
'Failure', 
'Mixed' 
) 
) 
)
) 
)

IF( pse__TotalNumberOfLogs__c = 0, 'Undefined',
    IF ( AND( pse__TotalNumberOfErrors__c=0,pse__TotalNumberOfAborts__c=0,pse__TotalNumberOfExternal__c=0), 
        'Successful', 
        IF(pse__TotalNumberOfErrors__c = pse__TotalNumberOfLogs__c, 
            'Failure', 
            IF(pse__TotalNumberOfAborts__c > 0, 
                'Failure', 
                IF( pse__TotalNumberOfExternal__c > 0, 
                    'Failure', 
                    'Mixed' 
                ) 
            ) 
        )
    )     
)

IF (
AND(
(pse__Historical_Calendar_Hours__c - pse__Historical_Excluded_Hours__c) = 0,
(pse__Historical_Billable_Hours__c > 0)
), 1, IF (
AND(
(pse__Historical_Calendar_Hours__c - pse__Historical_Excluded_Hours__c) = 0,
(pse__Historical_Billable_Hours__c= 0)
), 0,
((pse__Historical_Billable_Hours__c) / (pse__Historical_Calendar_Hours__c - pse__Historical_Excluded_Hours__c))
)
)

IF (
  AND(
    (pse__Historical_Calendar_Hours__c - pse__Historical_Excluded_Hours__c) = 0,
    (pse__Historical_Billable_Hours__c + pse__Historical_Credited_Hours__c > 0)
  ), 1, IF (
    AND(
      (pse__Historical_Calendar_Hours__c - pse__Historical_Excluded_Hours__c) = 0,
      (pse__Historical_Billable_Hours__c + pse__Historical_Credited_Hours__c = 0)
    ), 0,
    ((pse__Historical_Billable_Hours__c + pse__Historical_Credited_Hours__c) / (pse__Historical_Calendar_Hours__c - pse__Historical_Excluded_Hours__c))
    )
)

IF (
AND(
(pse__Scheduled_Calendar_Hours__c - pse__Scheduled_Excluded_Hours__c) = 0,
(pse__Scheduled_Billable_Hours__c > 0)
), 1, IF (
AND(
(pse__Scheduled_Calendar_Hours__c - pse__Scheduled_Excluded_Hours__c) = 0,
(pse__Scheduled_Billable_Hours__c= 0)
), 0,
((pse__Scheduled_Billable_Hours__c) / (pse__Scheduled_Calendar_Hours__c - pse__Scheduled_Excluded_Hours__c))
)
)

IF (
  AND(
    (pse__Scheduled_Calendar_Hours__c - pse__Scheduled_Excluded_Hours__c) = 0,
    (pse__Scheduled_Billable_Hours__c + pse__Scheduled_Credited_Hours__c > 0)
  ), 1, IF (
    AND(
      (pse__Scheduled_Calendar_Hours__c - pse__Scheduled_Excluded_Hours__c) = 0,
      (pse__Scheduled_Billable_Hours__c + pse__Scheduled_Credited_Hours__c = 0)
    ), 0,
    ((pse__Scheduled_Billable_Hours__c  + pse__Scheduled_Credited_Hours__c) / (pse__Scheduled_Calendar_Hours__c - pse__Scheduled_Excluded_Hours__c))
    )
)

IF (
AND(
(pse__Scheduled_Calendar_Hours__c + pse__Historical_Calendar_Hours__c - pse__Scheduled_Excluded_Hours__c - pse__Historical_Excluded_Hours__c) = 0,
(pse__Scheduled_Billable_Hours__c + pse__Historical_Billable_Hours__c > 0)
), 1, IF (
AND(
(pse__Scheduled_Calendar_Hours__c + pse__Historical_Calendar_Hours__c - pse__Scheduled_Excluded_Hours__c - pse__Historical_Excluded_Hours__c) = 0,
(pse__Scheduled_Billable_Hours__c + pse__Historical_Billable_Hours__c = 0)
), 0,
((pse__Scheduled_Billable_Hours__c + pse__Historical_Billable_Hours__c) / (pse__Scheduled_Calendar_Hours__c + pse__Historical_Calendar_Hours__c - pse__Scheduled_Excluded_Hours__c - pse__Historical_Excluded_Hours__c))
)
)

IF (
  AND(
    (pse__Scheduled_Calendar_Hours__c + pse__Historical_Calendar_Hours__c - pse__Scheduled_Excluded_Hours__c - pse__Historical_Excluded_Hours__c) = 0,
    (pse__Scheduled_Billable_Hours__c + pse__Historical_Billable_Hours__c + pse__Scheduled_Credited_Hours__c + pse__Historical_Credited_Hours__c > 0)
  ), 1, IF (
    AND(
      (pse__Scheduled_Calendar_Hours__c + pse__Historical_Calendar_Hours__c - pse__Scheduled_Excluded_Hours__c - pse__Historical_Excluded_Hours__c) = 0,
      (pse__Scheduled_Billable_Hours__c + pse__Historical_Billable_Hours__c + pse__Scheduled_Credited_Hours__c + pse__Historical_Credited_Hours__c = 0)
    ), 0,
    ((pse__Scheduled_Billable_Hours__c + pse__Historical_Billable_Hours__c + pse__Scheduled_Credited_Hours__c + pse__Historical_Credited_Hours__c) / (pse__Scheduled_Calendar_Hours__c + pse__Historical_Calendar_Hours__c - pse__Scheduled_Excluded_Hours__c - pse__Historical_Excluded_Hours__c))
    )
)
